script: |
  super -f text -I q10210.spq | sort > q10210.out

inputs:
  - name: q10210.spq
    data: |
      SELECT + tab0.col1 + + col2 FROM tab0 (FORMAT parquet) WHERE ( - col2 ) NOT BETWEEN ( col1 ) AND + col0 * col1;
  - name: tab0

outputs:
  - name: q10210.out
    data: |
      119
      173
      98
